<p><hi rend="bold">گەنسۇ ئۆلكىسى</hi> بولسا <ref target="https://ug.wikipedia.org/wiki/جۇڭخۇا_خەلق_جۇمھۇرىيىتى">جۇڭخۇا خەلق جۇمھۇرىيىتى</ref> دىكىبىخاھار 2004 نوپۇس بار، گەنسۇنىڭ 26،190،000 نوپۇسىبار، 454،000 كم² دائىرائىقىدا نوپۇس جايلاخكان، خىمالىكاڭ لىك 38.0°، خارىكى ئۇزۇنلۇك 102°20.</p>
